import React, { useState, useEffect } from 'react';
import getBoard from '../Axios/BoardListAxios';

function BoardList() {

    const [board, setTitle] = useState([]);
    

    function callback(data){
        setTitle(data);
        
    }

    useEffect(
        () => {
            getBoard(callback);
        }, []
    );
    const boardTitle = board.map(board => <h1 key={board.borderSeq}>{board.title}</h1>);
    const boardConts = board.map(board => <h1 key={board.borderSeq}>{board.conts}</h1>)
    return(
   <div>
    <div>{boardTitle}</div>
    <div>{boardConts}</div>
   </div>
    );
}

export default BoardList;
